- input: "TEXT\x1CC00143743\x1C1\x1C\x1CF3XA\x1CFebruary 23, 2011  Mr. Daniel Buckley
    Federal Election Commission Washington, DC 20463  Re:  Amended 2010 12 Day Pre-General
    Report  Dear Mr. Buckley:  The following responds to your letter of January 19,
    2011 regarding the Amended 2010 12 Day Pre-General Report, filed by the Republican
    Party of Texas -RPT.  Schedule B, supporting line 21b, originally disclosed negative
    entries totaling $5,944.58 as offsets to in-kind expenses for Line 23 and has
    been corrected as offsets to Schedule B, supporting line 29.  Schedule B, line
    21b Non-Allocable Voter Registration Mailings and FEA GOTV Mailers were Party
    communications that did not reference any clearly identified candidate for Federal
    office nor that promoted, supported, attacked or opposed any candidate for Federal
    office.  Previously reported coordinated expenditure made directly to a candidate
    committee has been corrected and moved to line 21b.  The Republican National Committee
    made an in-kind contribution of telephone and other office equipment which was
    duly reported on this report and previously on the October Monthly Report by the
    Party.  The Party then made this available to candidate committees and declared
    the RNC as the vendor since that is the entity from which the phones were received.
    \ This activity was reported on Schedule F as coordinated expenditures in the
    amounts of $1785.33 and $1378.00 totaling $3,163.33.  Schedule H2 discloses one
    Party fundraising event for this reporting period.  The Party did not use any
    federal candidate names in any special communications, fundraising event or advertising
    projects.  Schedule H2 ratio has been corrected to show same event ratio as previously
    reported for this reporting period.   Tom Mechler, Treasurer Republican Party
    of Texas\n"
